import SPPACECertificate from './certificate';
import SPPACETranscript from './transcript';

const templates = [
  {
    id: 'certificate',
    label: 'Certificate',
    template: SPPACECertificate
  },
  {
    id: 'transcript',
    label: 'Transcript',
    template: SPPACETranscript
  }
];

export default templates;
